class EarCatalog {

    private static _instance: EarCatalog;

    public static get instance() {
        if (EarCatalog._instance == null) {
            EarCatalog._instance = new EarCatalog();
        }
        return EarCatalog._instance;
    }

    getHiddenEar(token: Token) {
        if (token.species === Species.Ferengi) {
            switch (token.speciesOption) {

                case SpeciesOption.Option4:
                    return FerengiEar4.Back.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case SpeciesOption.Option3:
                    return FerengiEar3.Back.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case SpeciesOption.Option2:
                    return FerengiEar2.Back.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);

                case SpeciesOption.Option1:
                default:
                    return FerengiEar1.Back.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            }
        } else {
            return "";
        }
    }

    getEar(token: Token) {
        if (SpeciesRestrictions.isRubberHeaded(token.species) && token.species !== Species.Jelna) {
            return "";
        } else if (token.species === Species.Vulcan || token.species === Species.Romulan) {
            return VulcanEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR, token.skinColor);
        } else if (token.species === Species.Cardassian) {
            return CardassianEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR, token.skinColor);
        } else if (token.species === Species.Denobulan) {
            return DenobulanEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR, token.skinColor);
        } else if (token.species === Species.Tellarite) {
            return TellariteEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR, token.skinColor);
        } else if (token.species === Species.Bolian) {
            return BolianEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR, token.skinColor);
        } else if (token.species === Species.Ferengi) {
            switch (token.speciesOption) {

                case SpeciesOption.Option4:
                    return FerengiEar4.Front.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case SpeciesOption.Option3:
                    return FerengiEar3.Front.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case SpeciesOption.Option2:
                    return FerengiEar2.Front.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case SpeciesOption.Option1:
                default:
                    return FerengiEar1.Front.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            }
        } else {
            return StandardEar.replace(SpeciesColors.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        }
    }

}

export default EarCatalog;